import React, {useState, useEffect} from "react";
import {Link} from "react-router-dom";
import SecondNavBar from "./SecondNavBar";
import OrderImg from "../../assets/order.svg";
import PendingImg from "../../assets/pending.svg";
import DeliveryImg from "../../assets/delivery.svg";

const AdminDashboardNavBar = () => {

    const [order, setOrder] = useState("");
    const [receive, setReceive] = useState("");
    const [pending, setPending] = useState("");
    const [delivered, setDelivered] = useState("");



    const callReceived = () => {
        setReceive(true);
    }

    const callPending = () => {
        setPending(true);
    }

    const callDelivered = () => {
        setDelivered(true);
    }

    useEffect(() => {

        let isActive = true;

        if (isActive){


            if(window.location.href.split("/").pop() === "admindashboardhome"){
                callReceived();
            }

            if(window.location.href.split("/").pop() === "admindashboardpending"){
                callPending(); 
            }

            if(window.location.href.split("/").pop() === "admindashboarddeliveries"){
                callDelivered();
            }

        }
        return () => {
            isActive = false;
          };


    },[]);

    return(
        <div>
            <SecondNavBar />
            <nav>
                <ul className="uldash">
                    <Link className="dashnav dashnav1" to="/admindashboardhome"><li> <img className="dashicon dashicon1" src={OrderImg} alt="dash"/> Order</li></Link>
                    <Link className="dashnav dashnav2" to="/admindashboardpending"><li> <img className="dashicon dashicon2" src={PendingImg} alt="dash"/> Pending</li></Link>
                    <Link className="dashnav dashnav3" to="/admindashboarddeliveries"><li> <img className="dashicon dashicon3" src={DeliveryImg} alt="dash"/> Delivered</li></Link>
                </ul> 
            </nav>
        </div>
    ) 
}

export default AdminDashboardNavBar;
